import React from 'react';

const SizeChartScreen = () => {
	return (
		<>
			<div>
				<h1> Size Chart </h1>
				<p style={{ textAlign: 'center' }}>
					{' '}
					We believe in inclusiveness, hence, we have a size for ALL. Please
					select the size that fits you!
				</p>
				<img
					src="/images/Size-Chart.jpg"
					style={{ width: '1300px', marginLeft: '50px' }}
				/>
			</div>
		</>
	);
};

export default SizeChartScreen;
